import { createApp } from "vue";
import App from "./App.vue";
import "./all.min.css";
import "./bootstrap.min.css";
import "./bootstrap.min.css.map";

import navbar from "./components/Navbar.vue";
const app = createApp(App);
app.component("nav-bar", navbar);
app.mount("#app");
